import React, { Component } from 'react'

class Nav extends Component {
  render(){
    return (
      <nav className='navtop'>
        <h2>ㅇㅎ</h2>
        <ul className='nav-links'>
          <li><a href='/'>Main</a></li>
          <li><a href='/about'>About</a></li>
          <li>Lessons</li>
        </ul>
      </nav>
    )
  }
}

export default Nav;
